/* eslint-disable no-use-before-define */
import React from 'react';
import { Drawer, Box, List, ListItemIcon, ListItemButton, ListItemText } from '@mui/material'

const items = [
  {
    title: '업체정보'
  },
  {
    title: '구매관리'
  },
  {
    title: '재고관리'
  },
  {
    title: '영업관리'
  },
]

const NavBar = () => {
  return (
    <Box>
      <img
        alt="Logo"
        // src="/static/T2.png"
        src="./nav_logo.png"
      />

    </Box>

  );
};

export default NavBar;
